# Load necessary libraries
library("tidyverse")
library("readxl")
library("data.table")
library("shiny")
library("shinylive")

# Load O*NET data files
mass_comm_occupation_data <- fread("appdata/mass_comm_occupation_data.csv")
occupation_wages <- fread("appdata/occupation_wages.csv")
top_skills <- fread("appdata/top_skills.csv")
key_technologies <- fread("appdata/key_technologies.csv")

# Shiny UI
ui <- fluidPage(
  # Include the custom CSS
  tags$head(
    tags$style(HTML("
      @charset 'utf-8';
      @import url('https://fonts.googleapis.com/css2?family=Lexend+Giga:wght@100..900&family=Lexend:wght@100..900&family=Public+Sans:ital,wght@0,100..900;1,100..900&display=swap');
      :root {
        --white-color: #ffffff;
        --10-grey-color: #f2f2f2;
        --90-grey-color: #1a1a1a;
        --black-color: #000000;
        --accent-one: #ea4335;
        --header-font: 'Lexend';
        --body-font: 'Public Sans';
      }
      body {
        font-family: var(--body-font);
        color: var(--90-grey-color);
        background-color: var(--white-color);
        max-width: 1440px;
        margin: auto;
        font-size: 1em;
        line-height: 2em;
      }
      h1, h2, h3, h4, h5, h6 {
        color: var(--accent-one);
        font-family: var(--header-font);
        font-weight: 700;
        text-transform: uppercase;
      }
      h1 {
        font-size: 2em;
        font-weight: 900;
      }
      h2 {
        font-size: 1.5em;
        font-weight: 800;
      }
      h3 {
        font-size: 1.25em;
        font-family: var(--header-font);
        color: var(--90-grey-color);
      }
      a {
        font-family: var(--body-font);
        font-weight: 400;
        color: var(--90-grey-color);
        text-decoration: none;
      }
      a:hover {
        color: var(--accent-one);
        font-weight: 600;
      }
      footer {
        padding-top: 2.5em;
        text-align: center;
      }
      footer a {
        font-family: var(--header-font);
      }
    "))
  ),
  titlePanel("Mass Communication Careers Dashboard"),
  fluidRow(
    # Left column for dropdowns and job details
    column(
      width = 4,
      selectInput("job_title", 
                  "Select a Job Title:", 
                  choices = c("-", sort(unique(mass_comm_occupation_data$Title))),
                  selected = "-"),
      selectInput("state", 
                  "Select a State:", 
                  choices = c("-", sort(unique(occupation_wages$AREA_TITLE))),
                  selected = "-"),
      h3("Job Details"),
      textOutput("description"),
      h4("Alternate Titles"),
      textOutput("alt_titles"),
      h4("Bureau of Statistics Data"),
      tableOutput("stats_table")
    ),
    
    # Middle column for Skills
    column(
      width = 4,
      h4("Top Skills"),
      tableOutput("skills_table")
    ),
    
    # Right column for Technology
    column(
      width = 4,
      h4("Key Technology Skills"),
      tableOutput("technology_table")
    )
  ),
  fluidRow(
    column(
      width = 12,
      tags$footer(
        "Data for this dashboard has come from the ",
        tags$a(href = "https://www.onetcenter.org/database.html", "O*NETÂ® 29.1 Database", target = "_blank"),
        " and the ",
        tags$a(href = "https://www.bls.gov/oes/tables.htm", 
               "U.S. Bureau of Labor Statistics Occupational Employment and Wage Statistics", 
               target = "_blank"),
        "."
      )
    )
  )
)

# Shiny Server
server <- function(input, output) {
  # Reactive data for selected job title
  selected_job <- reactive({
    req(input$job_title != "-")
    mass_comm_occupation_data %>%
      filter(Title == input$job_title)
  })
  
  # Reactive data for filtered wages
  filtered_wages <- reactive({
    req(input$job_title != "-", input$state != "-")
    occupation_wages %>%
      filter(OCC_CODE == selected_job()$OCC_CODE & AREA_TITLE == input$state)
  })
  
  # Job description
  output$description <- renderText({
    req(input$job_title != "-")
    selected_job()$Title
  })
  
  # Alternate Titles
  output$alt_titles <- renderText({
    req(input$job_title != "-")
    selected_job()$`Alternate Titles`
  })
  
  # Bureau of Statistics Data
  output$stats_table <- renderTable({
    req(input$job_title != "-", input$state != "-")
    filtered_wages() %>%
      select(H_MEAN, A_MEAN, H_MEDIAN, A_MEDIAN) %>%
      rename(
        `Mean Hourly Wage` = H_MEAN,
        `Mean Annual Wage` = A_MEAN,
        `Median Hourly Wage` = H_MEDIAN,
        `Median Annual Wage` = A_MEDIAN
      )
  })
  
  # Top 10 Skills
  output$skills_table <- renderTable({
    req(input$job_title != "-")
    top_skills %>%
      filter(OCC_CODE == selected_job()$OCC_CODE) %>%
      select(`Element Name`, LV) %>%
      rename(Skill = `Element Name`, Level = LV)
  })
  
  # Key Technology
  output$technology_table <- renderTable({
    req(input$job_title != "-")
    key_technologies %>%
      filter(OCC_CODE == selected_job()$OCC_CODE) %>%
      select(`Commodity Title`, Example) %>%
      rename(Technology = `Commodity Title`, Example = Example)
  })
}

# Run the app
shinyApp(ui = ui, server = server, options = list(launch.browser = TRUE))
